import React, { useState } from 'react';
import { Box, Paper, Typography } from '@mui/material';

import BasicStaffDataGrid from '../../components/Staffs/StaffsCreate/BasicStaffDataGrid';
import useStaffForm from '../../components/Staffs/useStaffForm';

const StaffCreateMUi = () => {
  const {
    staffData,
    handleInputChange,
    handleSubmit
  } = useStaffForm();

  return (
    <Box component='form' autoComplete="off">
      <Paper sx={{
        // p: 2,
        m: 4,
        width: '60rem',
        minWidth: '20rem',
      }} elevation={6}>
        <Box sx={{ p: 2 }}>
          <Typography variant='h2' gutterBottom fontWeight='bold' sx={{ color: '#03074f', fontSize: '2rem' }}>
              Στοιχεία Προσωπικού
          </Typography>
        </Box>
        <BasicStaffDataGrid data={staffData} handleInputChange={handleInputChange}/>
        <Paper sx={{
          border: '20px solid black',
          mt: 3
        }}></Paper>
      </Paper>
    </Box>
  )
}

export default StaffCreateMUi;
